import React from 'react';
import {Component} from 'react';
import Header from './Header.jsx';
import './App.css';
import Homepage from './Homepage.jsx';
import Navi from './nav.jsx';
import Locations from './Locations.jsx';
import Locationdata from './Locationdata.jsx';
import './w3.css'




class App extends Component {
  constructor()
  {
    super();
    this.state=
    {
      id:''
    }
  }


  Handle = (f) => 
  { 
    this.setState({id:f});
  }



  render()
{
  return (
    <div className="App">

     <Header heading="heading"/>
     <Navi id={this.state.id}/>
     <div id="maindata">
     <Homepage/>
     <Locations ids={this.Handle}/>
     <Locationdata/>
     </div>







    </div>
  );
}
}

export default App;
